class Solution:
    def findSpecialInteger(self, arr: List[int]) -> int:
        l = len(arr) // 4
        nm = 1
        nd = 0
        d = arr[0]
        for i in range(1,len(arr)):
            if arr[i] > arr[i-1]:
                if nm > nd:
                    d = arr[i]
                    nd = nm
                nm = 1
            else:
                nm += 1
                if nm > l:
                    return arr[i]
        return d

    def removeCoveredIntervals(self, intervals: List[List[int]]) -> int:
        intervals.sort(key=lambda x:x[0])
        cnt = 1
        lm = intervals[0][1]
        for i in range(1,len(intervals)):
            if intervals[i][1] > lm:
                cnt += 1
                lm = intervals[i][1]
        return cnt


