        # go(0,0,-1)
        # return ans[0]
        inf = 10 ** 9
        n = len(arr)
        if n == 1:
            return arr[0][0]
        for i in range(1,n):
            lm = arr[i-1].copy()
            v1 = min(lm)
            c1 = arr[i-1].index(v1)
            lm[lm.index(v1)] = inf
            v2 = min(lm)
